import React from 'react';
import Box from '@mui/system/Box';
import Grid from '@mui/material/Grid';
import List from '@mui/material/List';
import ListItemText from '@mui/material/ListItemText';
import Paper from '@mui/material/Paper';
import Typography from '@mui/material/Typography';
import Section from "../Section";
import gt from '../../pictures/GeorgiaTech.png';
import osu from '../../pictures/OhioState.png';
import "../../styles/Education.css";

function Education() {
    return (
        <Grid container direction="column" spacing={0}>
            <Grid item>
                <Section
                    title="Georgia Institute of Technology"
                    subtitle="Master's of Science in Computer Science"
                    img={gt}
                    alt="Georgia Tech"
                    imgWidth="0.8"
                    infoList={[
                            ["THIS IS A TEST", "it's a gpa."],
                            ["Outline of Program", "the program is of such information and learning."],
                            ["Class Highlights", "classes i've taken are of such variety"]
                    ]}
                />
            </Grid>
            <Grid item>
                <Paper variant="elevation" elevation={10} sx={{backgroundColor: "#F7F4EA", borderRadius: "10px"}} className="paper">
                    <Grid container direction="row" alignItems="center" spacing={2} className="grid">
                        <Grid item xs={6}>
                            <Box
                                component="img"
                                sx={{maxWidth: { xs: 350, md: 250 }}}
                                src={osu} 
                                alt="OSU" 
                            />
                        </Grid>
                        <Grid item xs={6}>
                            <Typography component="h1" className="title">Ohio State University</Typography>
                            <Typography component="h3" className="subtitle">Bachelor's of Science in Biomedical Engineering</Typography>
                            <List>
                                <ListItemText primary="GPA" secondary="it's a gpa." />
                                <ListItemText primary="Outline of Program" secondary="the program is of such information and learning." />
                                <ListItemText primary="Class Highlights" secondary="classes i've taken are of such variety" />
                            </List>
                        </Grid>
                    </Grid>
                </Paper>
            </Grid>
        </Grid>
    );
}

export default Education;
